(2, 'Streunerkatzen\\Cat', '2018-12-09 12:43:43', '2018-12-09 12:43:43', 'Alice', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'braun', NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'Sehr anhänglich und verschmust', 'Anfangs ängstlich. Sobald sie Vertrauen zu Menschen hat ist sie auch sehr verschmust', '2017-05-16', NULL, NULL, 0, 'Oberösterreich', NULL, NULL, 5, 1, 1, 19, 0, 2),
