(58, 'Streunerkatzen\\Cat', '2018-12-09 12:43:48', '2018-12-09 12:43:48', 'Pauli', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, NULL, 'ja', 'nicht bekannt', 'nein', 'sehr zutraulicher, verschmuster Kater, frisst leidenschaftlich gerne und bettelt gerne darum.', 'sehr zutraulich und auch bei Fremden gleich verschmust und holt sich seine Streicheleinheiten ab.', '2015-08-10', 'Bischelsdorf', NULL, 0, 'Oberösterreich', NULL, NULL, 3, 1, 1, 23, 0, 58),
