(67, 'Streunerkatzen\\Cat', '2018-12-09 12:43:48', '2018-12-09 12:43:48', 'Jacky', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, NULL, 'ja', 'nicht bekannt', 'nein', 'sehr anhänglich und verschmust. Jacky ist eine Handaufzucht von mir und hat eine besondere Eigenheit. Wenn man \\\"Jacky Nuckeldecke\\\" schreit kommt er angerannt und springt auf seine Nuckeldecke und beginnt sofort zu Nuckeln bis er schließlich dabei einschläft.', 'Fremden gegenüber ist er auch zutraulich und wenn man ihn auf den Arm nimmt genießt er es getragen zu werden', '2015-09-13', 'Kilianstrasse 15', NULL, 0, 'Oberösterreich', NULL, NULL, 4, 1, 1, 27, 0, 67),
(68, 'Streunerkatzen\\Cat', '2018-12-09 12:43:49', '2018-12-09 12:43:49', 'Timmi', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', NULL, NULL, '2016-01-03', 'Bockgasse', NULL, 0, 'Oberösterreich', NULL, NULL, 1, 1, 1, 30, 0, 68),
(69, 'Streunerkatzen\\Cat', '2018-12-09 12:43:49', '2018-12-09 12:43:49', 'unbekanntes Streunerkatzi', NULL, NULL, 'nicht bekannt', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'nicht bekannt', 'nicht bekannt', 'nicht bekannt', NULL, 'Vermisst jemand so eine Katze/Kater? Gesichtet in 4892 Oberalberting (zw. Fornach und Vöcklamarkt)  Sie war im Winter total ausgehungert und hat bei uns draußen gegessen, aber damals schon keine Chance, sie zu fangen oder auch nur ein Foto zu machen. Nach 2 Wochen ca. war sie wieder weg. Jetzt ist sie mir wieder aufgefallen. Sie ist in Wiesen und Feldern unterwegs und extrem scheu. Sie flüchtet sofort..aber nicht Richtung Häuser sondern Richtung Wald .. Auf mich wirkts wie ein Streuner, der sich', '2016-08-01', NULL, NULL, 0, 'Oberösterreich', NULL, NULL, 1, 2, 4, 17, 69, 0),
(70, 'Streunerkatzen\\Cat', '2018-12-09 12:43:49', '2018-12-09 12:43:49', 'Unbekannt', NULL, NULL, 'männlich', 0, NULL, NULL, NULL, NULL, NULL, NULL, 'Langhaarkatze', 'ja', 'nicht bekannt', 'nein', 'Sehr großer schwarzer Kater mit weißen Brustfleck gefunden in graz.', NULL, '2014-06-27', NULL, NULL, 0, 'Steiermark', NULL, NULL, 1, 2, 3, 15, 70, 0),
(71, 'Streunerkatzen\\Cat', '2018-12-09 12:43:49', '2018-12-09 12:43:49', 'Kovu', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'er einjährige Kater Kovu wurde zuletzt am 30.07.2015 in der Nähe der FeldgasseKleegasse in Wulkaprodersdorf gesehen. Er ist zutraulich, miaut viel, seine Schwanzspitze ist ein wenig geknickt, reagiert auf Zuruf \\\"maz-maz!\\\"', NULL, '2015-07-30', 'Kleegasse 7', NULL, 0, 'Burgenland', NULL, NULL, 1, 1, 1, 22, 0, 71),
