(125, 'Streunerkatzen\\Cat', '2018-12-09 12:43:53', '2018-12-09 12:43:53', 'Amy', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, NULL, 'ja', 'nicht bekannt', 'nein', 'Amy ist verschmust, liebt Bänder aller Art, ist immer hungrig und miaut sehr viel und gerne. <br />\r\n<br />\r\nSie war in der vorigen Wohnung fast nur draußen, in der neuen Wohnung wollte sie gar nicht ohne uns raus und ist uns nie von der Seite gewichen.', 'Fremden gegenüber ist Amy eher scheu, lässt sich kaum anfassen.', '2015-07-22', 'Prechtlerstraße', NULL, 0, 'Oberösterreich', NULL, NULL, 5, 1, 1, 19, 0, 125),
