(204, 'Streunerkatzen\\Cat', '2018-12-09 12:44:00', '2018-12-09 12:44:00', 'Fridolin', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'Frido ist ein seeehr verschmuster und zutraulicher Geselle mit einem sonnigen Gemüt und immer freundlichem Wesenszug.<br />\r\nEr verbreitet immer viel Freude mit seiner Anwesenheit und freut sich über jede Aufmerksamkeit.', 'Er ist anfangs etwas vorsichtig wird allerdings sehr schnell zutraulich, wenn man ihm zeigt dass man es gut mit ihm meint. Er hört auf auf den Rufnamen \\\"Bobo\\\"!', '2011-12-27', 'Matzelsdorf 16', NULL, 0, 'Niederösterreich', NULL, NULL, 5, 1, 1, 27, 0, 204),
(205, 'Streunerkatzen\\Cat', '2018-12-09 12:44:00', '2018-12-09 12:44:00', 'Tiger', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'braun', NULL, NULL, 'Europäisch Kurzhaar', 'ja', 'nicht bekannt', 'nein', 'Scheu, war ursprünglich ein Streuner, lässt sich durch Futter anlocken', 'Scheu', '2016-02-16', 'Babenbergerstr.', NULL, 0, 'Niederösterreich', NULL, NULL, 5, 1, 1, 17, 0, 205),
