(207, 'Streunerkatzen\\Cat', '2018-12-09 12:44:00', '2018-12-09 12:44:00', 'Burli', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'europ. kurzhaar getigert', 'ja', 'nicht bekannt', 'nein', '<p>burli ist sehr zutraulich und verspielt. er begleitete immer gern die leute in die wohnungen. das halsband hat er ständig abgestreift (sicherheitsverschluss), burli bringt den ball zum spielen, kuschelt sich gern zum körper, klopft mit der pfote auf die schulter wenn er hunger hat. er ist sehr lebendig und braucht viel auslauf.  wichtig ist dass er ein problem mit dem harnlassen hat seit der amputation. er putzt sich und dabei spritzt der harn heraus, den er teilweise auch trinkt. er schläft,', '<p>fremden gegenüber machte er keinen unterschied, er läuft fremden nach, z.b. hundebesitzern beim gassi gehen, begleitete ältere damen beim einkaufen nach hause und kinder in die schule, bis vor die tür</p>', '2010-11-29', 'Afritschweg 16', NULL, 0, 'Oberösterreich', NULL, NULL, 5, 1, 1, 17, 0, 207),
(208, 'Streunerkatzen\\Cat', '2018-12-09 12:44:00', '2018-12-09 12:44:00', 'Fiebi', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'EKH', 'ja', 'nicht bekannt', 'nein', 'Nach dem Umzug in eine andere Wohnung hatte Fiebi starken Freiheitsdrang, sie geht draußen ihrem Besitzer nicht zu. Fiebi war bis zu ihrem 5. Lebensjahr eine Streunerin', 'eher scheu, von einer Spaziergeherin hat sie sich angeblich streicheln lassen', '2015-10-01', 'Ellbognerstrasse', NULL, 0, 'Oberösterreich', NULL, NULL, 1, 1, 1, 27, 0, 208),
(209, 'Streunerkatzen\\Cat', '2018-12-09 12:44:00', '2018-12-09 12:44:00', 'Charly', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Hauskatze getigert', 'ja', 'nicht bekannt', 'ja', 'spricht gerne', NULL, '2018-03-20', 'Munggenaststraße', NULL, 0, 'Niederösterreich', NULL, NULL, 3, 1, 1, 17, 0, 209),
(210, 'Streunerkatzen\\Cat', '2018-12-09 12:44:00', '2018-12-09 12:44:00', 'Strolchi', NULL, NULL, 'männlich', 0, NULL, NULL, NULL, NULL, NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'Sehr verschmutzen zutraulicher Kater', NULL, '2015-12-08', 'Waldmannsgasse 21', NULL, 0, 'Niederösterreich', NULL, NULL, 4, 1, 1, 15, 0, 210),
(211, 'Streunerkatzen\\Cat', '2018-12-09 12:44:00', '2018-12-09 12:44:00', 'Mung', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Hauskatze rot', 'ja', 'nicht bekannt', 'nein', 'sehr zutraulich', NULL, '2018-03-19', 'Munggenaststraße', NULL, 0, 'Niederösterreich', NULL, NULL, 5, 1, 1, 16, 0, 211),
(212, 'Streunerkatzen\\Cat', '2018-12-09 12:44:00', '2018-12-09 12:44:00', 'dundo', NULL, NULL, 'männlich', 0, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Hauskatze', 'nein', 'nicht bekannt', 'nein', 'Unser Kater ist sehr verschmust und zutraulich. Lässt sich gerne von uns in die Arme nehmen und herumtragen. \\\"spricht\\\" auch gerne.', 'Fremden gegenüber ist er ein wenig vorsichtig, doch er ist leicht mit Futter anzulocken und lässt sich dann auch gerne streicheln.', '2019-03-19', NULL, NULL, 0, 'Niederösterreich', NULL, NULL, 1, 1, 1, 22, 0, 212),
(213, 'Streunerkatzen\\Cat', '2018-12-09 12:44:00', '2018-12-09 12:44:00', 'Unbekannt', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'sonstiges', NULL, NULL, 'hauskatze', 'nicht bekannt', 'nicht bekannt', 'nicht bekannt', NULL, 'sehr zutraulich, liebesbedürftig', '2016-01-18', 'Feldstraße', NULL, 0, 'Niederösterreich', NULL, NULL, 4, 2, 1, 17, 213, 0),
(214, 'Streunerkatzen\\Cat', '2018-12-09 12:44:01', '2018-12-09 12:44:01', 'Pirino', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, 'Karthäusermischling', 'ja', 'nicht bekannt', 'nein', 'Sehr anhänglich, ruhig, geht normalerweise nie lange weg, muss besonders beim Essen immer \\\"beknuddelt\\\" werden, redet hauptsächlich um auf Bedürfnisse (wie z.B. hinaus- oder hereinwollen, essen etc.) aufmerksam zu machen. STIMME = WIE SIMONSCAT (youtubecartoons von Simon Tofield)!!!', 'Eigentlich eher zutraulich, jedenfalls bei nicht zu lauten Menschen gibt er auch gleich Köpfchen und reibt sich. Kann auch wahrscheinlich gut \\\"geködert\\\" werden mit Schinken oder anderen Leckerlis.', '2011-12-19', 'Niederndorf', NULL, 0, 'Niederösterreich', NULL, NULL, 3, 1, 1, 29, 0, 214),
(215, 'Streunerkatzen\\Cat', '2018-12-09 12:44:01', '2018-12-09 12:44:01', 'Lumpi', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'zutraulich', 'zurückhaltend, vorsichtig, läßt sich nicht gerne angreifen.', '2015-11-20', NULL, NULL, 0, 'Oberösterreich', NULL, NULL, 1, 1, 1, 22, 0, 215),
