(249, 'Streunerkatzen\\Cat', '2018-12-09 12:44:03', '2018-12-09 12:44:03', 'Lucky', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'Er ist sehr anhänglich und auf \\\"seine\\\" Mensten sehr bezogen. Wir haben ihm auch Kunststücke beigebracht die für eine Katze ein bisschen ungewöhnlich sind: Sitz (setzt sich hin), nein (bleibt stehen), arme Katze (hebt die Pfote), hoch und schnippen (stellt sich auf seine Hinterbeine), er holt den Ball und hört auf seinen Namen.', 'Fremden gegenüber ist er zuerst eher vorsichtig (Kinder und laute Menschen weicht er aus), wenn er sich aber an jemanden gewöhnt hat, ist er auch Fremden gegenüber sehr anhänglich.', '2012-03-13', 'Packer Straße', NULL, 0, 'Steiermark', NULL, NULL, 5, 1, 1, 30, 0, 249),
