(255, 'Streunerkatzen\\Cat', '2018-12-09 12:44:04', '2018-12-09 12:44:04', 'Mausi', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', '<p>\\\"Mausi ist ein scheuer, großer Kater! Frisst gerne rohes Fleisch! Raufheben und herumtragen mag er gar nicht! Gestreichelt werden aber mag er sehr!</p>', '<p>Kindern gegenüber ist er offen. Vor Erwachsenen fürchtet er sich oft.</p>', '2016-01-02', NULL, NULL, 0, 'Niederösterreich', NULL, NULL, 5, 1, 1, 17, 0, 255),
