(260, 'Streunerkatzen\\Cat', '2018-12-09 12:44:04', '2018-12-09 12:44:04', 'Mona', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, 'EKH', 'ja', 'nicht bekannt', 'nein', 'Wir vermissen unsere Katze Mona aus 2751 Wöllersdorf-Steinabrückl, aus der Korngasse. Mona hat am 7. Oktober in der Früh das Haus verlassen für ihre morgendliche Runde und ist leider nicht heimgekehrt. Mona blieb immer in Rufweite. Flyer wurden im Ort verteilt, Tierärzte informiert, Straßenmeisterei hat keine tote Katze in der Gegend eingesammelt. Mona ist eine sehr gesprächige, eher freche Katze, die wir mit ihrer Mama und ihrer Schwester vor einem Jahr von der Straße aufgelesen haben. Mona ist', 'Fremden gegenüber war Mona scheu soweit wir das beurteilen können, aber es ist möglich dass jemand sie vielleicht dennoch anlocken konnte.', '2015-10-07', 'Korngasse 3/13', NULL, 0, 'Niederösterreich', NULL, NULL, 3, 1, 1, 17, 0, 260),
