(518, 'Streunerkatzen\\Cat', '2018-12-09 12:44:25', '2018-12-09 12:44:25', 'Findus', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'Er ist sehr verschmust und spricht auch gerne.', 'Fremden gegenüber ist er sehr ängstlich, er verkriecht sich sofort. Außerdem hat er Angst vor lauten Geräuschen.', '2013-08-16', 'St. Veiter Straße', NULL, 0, 'Steiermark', NULL, NULL, 5, 1, 1, 17, 0, 518),
(519, 'Streunerkatzen\\Cat', '2018-12-09 12:44:25', '2018-12-09 12:44:25', 'Mogli', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, 'Europäisch Kuzthaar', 'ja', 'nicht bekannt', 'nein', 'Anhänglich und verschmust, sehr eigenwillig, beißt auch mal zu wenn was nicht nach seinem Willen geht.', 'Misstrauisch, geht Fremden aus dm Weg.', '2017-02-06', 'Astenweg 4a', NULL, 0, 'Salzburg', NULL, NULL, 5, 1, 1, 22, 0, 519),
(520, 'Streunerkatzen\\Cat', '2018-12-09 12:44:25', '2018-12-09 12:44:25', 'Zoey', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'Zoey war eine sehr verschmuste Katze, die sich gerne auf einen legte. Allerdings mochte sie nicht gerne hochgehoben werden.', 'Zoey war Fremden gegenüber sehr offen und schmierte sich gleich um die Füße und lies sich streicheln und miaute fröhlich durch die Gegend.', '2014-04-07', 'Dr.-Karl-Widdmann-Straße 55', NULL, 0, 'Steiermark', NULL, NULL, 1, 1, 3, 29, 0, 520),
(521, 'Streunerkatzen\\Cat', '2018-12-09 12:44:25', '2018-12-09 12:44:25', 'Lily', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'Jagt gerne Mäuse und bringt sie nach hause und schreit laut bis sich jemand ihren Fang ansieht und frisst dann was sie gefangen hat.', 'Sehr scheu lässt sich nur manchmal streicheln meist rennt sie weg.', '2013-08-01', 'Unterwald  19', NULL, 0, 'Kärnten', NULL, NULL, 1, 1, 1, 27, 0, 521),
