(625, 'Streunerkatzen\\Cat', '2018-12-09 12:44:33', '2018-12-09 12:44:33', 'unbekannt', NULL, NULL, 'nicht bekannt', 0, NULL, NULL, NULL, NULL, NULL, NULL, 'ekh', 'nicht bekannt', 'nicht bekannt', 'nicht bekannt', 'Katze/Kater zugelaufen - in REDLTAL - nähe Frankenburg.<br />\r\n<br />\r\nKatze kommt seit 21.12. zum Essen. Anfangs war sie sehr zutraulich - dürfte also kein Streuner sein, aber wenn man die Tür zu macht, bekommt sie Panik und will weg.<br />\r\n<br />\r\nWer vermisst oder kennt dieses Muzi??', 'Katze/Kater zugelaufen - in REDLTAL - nähe Frankenburg.<br />\r\n<br />\r\nKatze kommt seit 21.12. zum Essen. Anfangs war sie sehr zutraulich - dürfte also kein Streuner sein, aber wenn man die Tür zu macht, bekommt sie Panik und will weg.<br />\r\n<br />\r\nWer vermisst oder kennt dieses Muzi??', '2013-12-21', NULL, NULL, 0, 'Oberösterreich', NULL, NULL, 1, 2, 4, 26, 625, 0),
