(637, 'Streunerkatzen\\Cat', '2018-12-09 12:44:34', '2018-12-09 12:44:34', 'Grauer Kater', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, NULL, NULL, NULL, 'ähnl. Kartäuser', 'ja', 'nicht bekannt', 'nein', 'Sehr zutraulich,miaut wenn er zu einem auf den schoss oder auf die chouch will ,als ob er fragt ( Darf ich zu dir)', 'Wenn sie sitzen will er bei ihnen sitzen und springt rauf un sich streicheln zu lassen', '2013-12-31', 'Tafernstrasse', NULL, 0, 'Vorarlberg', NULL, NULL, 3, 1, 1, 17, 0, 637),
(638, 'Streunerkatzen\\Cat', '2018-12-09 12:44:34', '2018-12-09 12:44:34', 'Rufus', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Europäische Kurzhaar', 'ja', 'nicht bekannt', 'nein', 'Sehr verschmust, hört wenn man ihn ruft, frisst alles, maunzt wenn man mit ihm spricht', 'keine ersichtliche Scheu', '2013-06-17', 'Tobadill', NULL, 0, 'Tirol', NULL, NULL, 5, 1, 1, 20, 0, 638),
(639, 'Streunerkatzen\\Cat', '2018-12-09 12:44:34', '2018-12-09 12:44:34', 'Kiara', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'Kiara ist wie eine Prinzessin, unsere beiden anderen Katzen sind in der Rangordnung hinter ihr, sie ist sehr klug nicht aufdringlich, sie ist wie ein Schweizer Uhrwerk hat ganz klare Rituale und Zeiten wo sie schläft, weggeht und wiederkommt, beobachtet ihre Umwelt genau, lässt sich nicht sehr gerne anfassen, außer sie kommt von selbst, macht aber gerne Nasenstupser auf Augenhöhe, steigt gerne in Autos und versteckt sich unter den Sitzen.', 'Fremden gegenüber ist sie eher zurückhaltend,misstrauisch.', '2013-08-06', 'Heidegasse 40', NULL, 0, 'Burgenland', NULL, NULL, 5, 1, 1, 27, 0, 639),
(640, 'Streunerkatzen\\Cat', '2018-12-09 12:44:34', '2018-12-09 12:44:34', 'Eyra', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, NULL, 'ja', 'nicht bekannt', 'ja', 'Verschmust, spricht gerne', NULL, '2014-01-02', NULL, NULL, 0, 'Vorarlberg', NULL, NULL, 5, 1, 1, 27, 0, 640),
(641, 'Streunerkatzen\\Cat', '2018-12-09 12:44:34', '2018-12-09 12:44:34', 'Pauli', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, NULL, 'ja', 'nicht bekannt', 'nein', NULL, 'er ist äußerst zutraulich und sehr neugierig. er läuft auch öfter in fremde häuser wenn die türe offen ist (Wohnbauten) und ist auch schon in ein fremdes auto gesprungen.', '2014-01-17', NULL, NULL, 0, 'Oberösterreich', NULL, NULL, 5, 1, 1, 25, 0, 641),
