(643, 'Streunerkatzen\\Cat', '2018-12-09 12:44:34', '2018-12-09 12:44:34', 'Gizmo', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'Er ist sehr verschmusst und hat ein ganz weiches Fell', 'misstrauisch', '2014-01-26', 'Kornblumeweg 3 /Parz 93', NULL, 0, 'Wien', NULL, NULL, 3, 1, 1, 30, 0, 643),
(644, 'Streunerkatzen\\Cat', '2018-12-09 12:44:34', '2018-12-09 12:44:34', 'Mutzi', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, 'Tigerkatze', 'nicht bekannt', 'nicht bekannt', 'nein', 'Sehr anhänglich, exterem Zutraulich und liebes Wesen, Gurrt meistens, beispielsweise wenn man sie anspricht. Bilder sind leider zu groß, sind jedoch auf tiersuche.at zu finden unter vermisste Katzen', 'eher zurückhaltend, hängt von der Person ab', '2014-01-22', 'Mühlbachstraße 6', NULL, 0, 'Salzburg', NULL, NULL, 5, 1, 1, 17, 0, 644),
