(648, 'Streunerkatzen\\Cat', '2018-12-09 12:44:35', '2018-12-09 12:44:35', 'Unbekannt', NULL, NULL, 'nicht bekannt', 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Hauskatze', NULL, 'nicht bekannt', 'nicht bekannt', NULL, NULL, '2014-01-27', NULL, NULL, 0, 'Niederösterreich', NULL, NULL, 4, 2, 1, 22, 648, 0),
(649, 'Streunerkatzen\\Cat', '2018-12-09 12:44:35', '2018-12-09 12:44:35', 'Tommy', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, 'Europäische Kurzhaar', 'ja', 'nicht bekannt', 'nein', 'Tommy ist sehr anhänglich und verschmaust. Will er gestreichelt werden springt er einem einfach vom Boden in die Arme. Er macht sich gerne mit Miauen bemerkbar und wird sehr von seinem Bruder vermisst.', 'Fremden gegenüber ist Tommy anfangs kurz scheu aber nach wenigen Minuten holt er sich bereits seine Kuscheleinheiten.', '2014-01-15', 'Kulmgasse', NULL, 0, 'Wien', NULL, NULL, 3, 1, 1, 16, 0, 649),
