(651, 'Streunerkatzen\\Cat', '2018-12-09 12:44:35', '2018-12-09 12:44:35', 'Rocky', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'braun', NULL, NULL, 'Europäisch Kurzhaar', 'ja', 'nicht bekannt', 'nein', 'zutraulich, verschmust', 'zögerlich aber lieb', '2013-12-26', NULL, NULL, 0, 'Oberösterreich', NULL, NULL, 5, 1, 1, 16, 0, 651),
(652, 'Streunerkatzen\\Cat', '2018-12-09 12:44:35', '2018-12-09 12:44:35', 'Lea', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'EKH', 'ja', 'nicht bekannt', 'ja', 'Lea ist sehr anhänglich und verschmust, kommt normal sofort angelaufen wenn sie denkt es gibt Leckerlies!', 'aufgeschlossen und zutraulich', '2017-12-06', 'Eglsee', NULL, 0, 'Oberösterreich', NULL, NULL, 3, 1, 1, 19, 0, 652),
(653, 'Streunerkatzen\\Cat', '2018-12-09 12:44:35', '2018-12-09 12:44:35', 'Timmy', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Hauskatzen', 'ja', 'nicht bekannt', 'nein', NULL, 'zugänglich', '2014-02-19', NULL, NULL, 0, 'Niederösterreich', NULL, NULL, 1, 1, 1, 16, 0, 653),
(654, 'Streunerkatzen\\Cat', '2018-12-09 12:44:35', '2018-12-09 12:44:35', 'Serafina', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, NULL, 'ja', 'nicht bekannt', 'nein', 'Sie ist ein verschmustes und verspieltes Kätzchen,ihr miauen ist nicht sehr lautstark, eher zart, sie ist auch sehr neugierig und liebt abenteuer.', NULL, '2013-11-29', NULL, NULL, 0, 'Niederösterreich', NULL, NULL, 1, 1, 1, 17, 0, 654),
