(660, 'Streunerkatzen\\Cat', '2018-12-09 12:44:36', '2018-12-09 12:44:36', 'Puma', NULL, NULL, 'weiblich', 0, NULL, NULL, NULL, 'grün', NULL, NULL, NULL, 'ja', 'nicht bekannt', 'nein', 'anhänglich, verschmust', 'scheu und ängstlich', '2015-10-23', 'Panoramagasse', NULL, 0, 'Niederösterreich', NULL, NULL, 4, 1, 3, 24, 0, 660),
