(664, 'Streunerkatzen\\Cat', '2018-12-09 12:44:36', '2018-12-09 12:44:36', 'Unbekannt', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'blau', NULL, NULL, NULL, 'nicht bekannt', 'nicht bekannt', 'nicht bekannt', NULL, 'Kaum angst vor fremden', '2015-03-16', NULL, NULL, 0, 'Niederösterreich', NULL, NULL, 1, 2, 3, 29, 664, 0),
(665, 'Streunerkatzen\\Cat', '2018-12-09 12:44:36', '2018-12-09 12:44:36', 'Tomy', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Europäisch Kurzhaar', 'ja', 'nicht bekannt', 'ja', 'Er ist extrem zutraulich,  nicht ängstlich, hat auch nicht wirklich Angst vor Hunden, reagiert auf seinen Namen, schläft wie ein Hendl,  mag es nicht wenn man seine Hinterpfoten berührt oder streichelt da kann er ganz böse werden und beißt bzw hackelt nach ..', 'Fremden gegenüber ist er sehr aufgeschlossen und kuschelt gern', '2016-05-27', 'Kleegasse 10', NULL, 0, 'Steiermark', NULL, NULL, 4, 1, 1, 27, 0, 665),
(666, 'Streunerkatzen\\Cat', '2018-12-09 12:44:36', '2018-12-09 12:44:36', 'Cockie', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, NULL, 'ja', 'nicht bekannt', 'nein', 'Sehr verspielt und eher selten schmusig. Sie liebt es zu raufen. Wenn sie was nicht mag oder genervt ist, wird in einer Tour miaut.', 'Bei Fremden sehr zurückhaltend. Versteckt sich erst mal und nimmt erst langsam Kontakt auf.', '2016-06-20', 'Bahnstraße', NULL, 0, 'Niederösterreich', NULL, NULL, 4, 1, 1, 24, 0, 666),
