(828, 'Streunerkatzen\\Cat', '2018-12-09 12:44:48', '2018-12-09 12:44:48', 'Balu', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Karthäuser', 'ja', 'nicht bekannt', 'ja', 'Uns gegenüber und unseren anderen zwei Katzen spielt er immer gerne den Boss. Er ist ein sehr anhänglicher, verschmuster Kater. Er hat immer Hunger, trinkt gerne Katzenmilch... er hat seit 2,5 Jahren dafür gekämpft Freigänger zu werden, eigentlich wollten wir das nicht, aber er hat uns keine Wahl mehr gelassen. Ca. 5 Wochen hat es wunderbar geklappt, er kam immer nach Hause, auch wenn nicht immer ganz unverletzt, aber er war da. Und seit dem 13. September 2014 ist er auf einmal wie vom Erdboden ', 'Fremnden gegenüber ist er eher reserviert. Wenn man aber seinen Namen ruft ist er vorerst sehr erfreut darüber, wenn er dann merkt, dass er denjenigen nicht kennt, dreht er sich um und geht... Wenn man ihn richtig hochnimmt (hat mit den Hinterbeinen Probleme), mag er auch sehr gerne gekuschelt und gekrault werden.', '2014-09-13', 'Klara-Blum-Gasse 4/17', NULL, 0, 'Wien', NULL, NULL, 4, 1, 1, 17, 0, 828),
