(1027, 'Streunerkatzen\\Cat', '2018-12-09 12:45:03', '2018-12-09 12:45:03', 'Mia', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'braun', NULL, NULL, 'Europäisch Kurzhaar+Maine coon Mix', 'nein', 'nicht bekannt', 'nein', 'Verschmust, spricht gerne \\\"bruuuh\\\", sehr verspielt, nimmt Futter und Spielzeug mit den Pfoten auf.', 'Verhalten gegenüber Fremden unbekannt', '2016-10-27', 'Abwinden Dorf', NULL, 0, 'Oberösterreich', NULL, NULL, 4, 1, 1, 17, 0, 1027),
(1028, 'Streunerkatzen\\Cat', '2018-12-09 12:45:03', '2018-12-09 12:45:03', 'Tiger', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Europäisch Kurzhaar', 'ja', 'nicht bekannt', 'nein', 'Sehr anhänglich, ziemlich verspielt, verschmust, lässt sich nicht so gerne tragen, neugierig', 'Misstrauisch, vorsichtig, sehr zurückhaltend, lässt sich gar nicht tragen', '2015-05-20', NULL, NULL, 0, 'Oberösterreich', NULL, NULL, 1, 1, 1, 29, 0, 1028),
(1029, 'Streunerkatzen\\Cat', '2018-12-09 12:45:03', '2018-12-09 12:45:03', 'Lola', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, NULL, 'ja', 'nicht bekannt', 'nein', 'Vorsichtig, bei Hunger verschmust und anhänglich, eigenwillig und sehr dominant', 'sehr zurückhalten, scheu, distanziert; anderen Tieren gegenüber nicht zutraulich!', '2016-12-24', 'Badenerstraße 11', NULL, 0, 'Niederösterreich', NULL, NULL, 5, 1, 1, 19, 0, 1029),
(1030, 'Streunerkatzen\\Cat', '2018-12-09 12:45:03', '2018-12-09 12:45:03', 'unbekannt', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'sonstiges', NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', NULL, NULL, '2015-06-03', 'Melissenweg 18', NULL, 0, 'Oberösterreich', NULL, NULL, 5, 2, 1, 16, 1030, 0),
(1031, 'Streunerkatzen\\Cat', '2018-12-09 12:45:03', '2018-12-09 12:45:03', 'Nejla', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'grün', NULL, NULL, 'Europ. Kurzhaar', 'ja', 'nicht bekannt', 'nein', 'Obwohl Freigänger (Pferdehof) kommt sie auf rufen sofort zu mit, sehr kuschelig und anhänglich und redet auch gerne', 'Anfangs zurückhaltend, wenn sie Vertrauen hat wird sie sehr schmusig', '2015-06-20', 'Schimpelsberg 1', NULL, 0, 'Oberösterreich', NULL, NULL, 5, 1, 1, 17, 0, 1031),
(1032, 'Streunerkatzen\\Cat', '2018-12-09 12:45:03', '2018-12-09 12:45:03', 'Charlie', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'braun', NULL, NULL, 'europ. kurzhaar', 'ja', 'nicht bekannt', 'ja', NULL, NULL, '2015-06-07', 'Weinwurmweg', NULL, 0, 'Wien', NULL, NULL, 4, 1, 1, 16, 0, 1032),
(1033, 'Streunerkatzen\\Cat', '2018-12-09 12:45:03', '2018-12-09 12:45:03', 'Mimy', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Europäische Hauskatze', 'ja', 'nicht bekannt', 'ja', 'Mimy ist sehr zutraulich und verschmust und ist es deshalb auch gewohnt im Bett zu schlafen. <br />\r\nWeiters ist sie sehr verspielt, und sie kann Kratzen und manchmal auch beißen wenn es ihr zu viel wird. Tagsüber schläft sie gerne und ist in der Nacht umso aktiver.', 'Fremden gegenüber ist sie Anfangs eher misstrauisch, doch sie fasst schnell Vertrauen zu ihnen.', '2015-03-06', 'Geiereckstraße 8', NULL, 0, 'Salzburg', NULL, NULL, 1, 1, 1, 24, 0, 1033),
(1034, 'Streunerkatzen\\Cat', '2018-12-09 12:45:03', '2018-12-09 12:45:03', 'Daisy', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Mischling', 'ja', 'nicht bekannt', 'ja', 'Daisy ist sehr zutraulich. Wir haben sie vor 4 Jahren als Baby gefunden - niemand hat sich gemeldet. Sie war offenbar ausgesetzt. <br />\r\nDaisy ist auch recht kommunikativ und kommt auch gut mit unseren 3 Hunden klar (Golden Retriever).', 'zu Hause war sie auch Fremden gegenüber offen.', '2015-05-25', 'Ligist 152', NULL, 0, 'Steiermark', NULL, NULL, 5, 1, 3, 27, 0, 1034),
(1035, 'Streunerkatzen\\Cat', '2018-12-09 12:45:03', '2018-12-09 12:45:03', 'Lelo', NULL, NULL, 'weiblich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Maine Coon Mischling (Silver Tabby)', 'nein', 'nicht bekannt', 'nein', 'Anhänglich, verschmust, sehr aufmerksamkeitsbedürftig, verspielt.<br />\r\nMorgens weckt sie einen immer auf weil sie Futter und Aufmerksamkeit will.<br />\r\n <br />\r\nTW schwieriges Essverhalten, braucht viel Abwechslung. Wenn sie nicht kriegt was sie will, wird sie unsauber und pinkelt auf Teppiche oder Polstermöbel. Das tut sie vor allem wenn man sie wegsperrt oder ihr das Futter nicht passt.', 'Sofern in gewohnter Umgebung sehr zutraulich und schamlos entspannt. Kratzt sich gerne an den Beinen von Besuchern hoch, weil sie in den Arm genommen werden möchte. <br />\r\nFreunde haben sie als lästig beschrieben.', '2015-06-10', 'Ottobauergasse 4', NULL, 0, 'Wien', NULL, NULL, 5, 1, 3, 17, 0, 1035),
(1036, 'Streunerkatzen\\Cat', '2018-12-09 12:45:03', '2018-12-09 12:45:03', 'Maxi', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, 'gelb', NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'Ist auf Besitzer fixiert. wohnt mit einem anderen Kater und zwei Pensionisten in ruhiger Umgebung.', 'Wenn er jemanden kennt bleibt er auf seinem Platz. Bei Fremden versteckt er sich.', '2015-05-30', 'Paulahofsiedlungsstrasse C3', NULL, 0, 'Steiermark', NULL, NULL, 4, 1, 1, 15, 0, 1036),
(1037, 'Streunerkatzen\\Cat', '2018-12-09 12:45:03', '2018-12-09 12:45:03', 'Rambo', NULL, NULL, 'männlich', 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Hauskatze', 'ja', 'nicht bekannt', 'nein', 'sehr liebevoll, zutraulich, ein richtiger Schmuser, sein Bruder vermisst ihm schon.<br />\r\nWenn man Ihm ruft kommt er sofort liebt die Kinder liebt die Freiheit. Eingesperrt sein mag er überhaupt nicht, dann leiden die Vorhänge und alles was man zerkratzen kann.', 'überhaupt nicht misstrauisch,', '2015-05-29', 'Orasteig 1', NULL, 0, 'Wien', NULL, NULL, 5, 1, 1, 27, 0, 1037),
(1038, 'Streunerkatzen\\Cat', '2018-12-09 12:45:04', '2018-12-09 12:45:04', 'Garfield', NULL, NULL, 'männlich', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ja', 'nicht bekannt', 'nein', 'Äußerst zutraulich und verschmust', 'zutraulich', '2015-06-16', 'Währingergürtel 59', NULL, 0, 'Wien', NULL, NULL, 3, 1, 1, 16, 0, 1038),
