INSERT INTO `sitetree` (`ID`, `ClassName`, `LastEdited`, `Created`, `CanViewType`, `CanEditType`, `Version`, `URLSegment`, `Title`, `MenuTitle`, `Content`, `MetaDescription`, `ExtraMeta`, `ShowInMenus`, `ShowInSearch`, `Sort`, `HasBrokenFile`, `HasBrokenLink`, `ReportClass`, `ParentID`) VALUES
(1, 'Page', '2018-09-09 11:33:07', '2018-09-09 11:33:07', 'Inherit', 'Inherit', 2, 'home', 'Startseite', NULL, '<p>Willkommen bei SilverStripe! Sie sehen hier die standard Homepage. Diese können Sie im <a href=\"admin/\">CMS</a> bearbeiten.</p><p>Sie können auch die englische  <a href=\"http://docs.silverstripe.org\">Dokumentation für Entwickler</a> lesen oder mit den <a href=\"http://www.silverstripe.org/learn/lessons\">SilverStripe lessons</a> lernen, wie Sie das CMS an Ihre Bedürfnisse anpassen.</p>', NULL, NULL, 1, 1, 1, 0, 0, NULL, 0),
(2, 'Page', '2018-09-09 11:33:07', '2018-09-09 11:33:07', 'Inherit', 'Inherit', 2, 'ueber-uns', 'Über uns', NULL, '<p>You can fill this page out with your own content, or delete it and create your own pages.</p>', NULL, NULL, 1, 1, 2, 0, 0, NULL, 0),
(3, 'Page', '2018-09-09 11:33:07', '2018-09-09 11:33:07', 'Inherit', 'Inherit', 2, 'kontakt', 'Kontakt', NULL, '<p>You can fill this page out with your own content, or delete it and create your own pages.</p>', NULL, NULL, 1, 1, 3, 0, 0, NULL, 0),
(4, 'SilverStripe\\ErrorPage\\ErrorPage', '2018-09-09 11:33:07', '2018-09-09 11:33:07', 'Inherit', 'Inherit', 2, 'seite-nicht-gefunden', 'Seite nicht gefunden', NULL, '<p>Entschuldigung, möglicherweise versuchen Sie eine Seite zu erreichen die nicht existiert.</p><p>Bitte überprüfen Sie die Schreibweise der URL die Sie versucht haben zu erreichen und versuchen Sie es noch einmal.</p>', NULL, NULL, 0, 0, 4, 0, 0, NULL, 0),
(5, 'SilverStripe\\ErrorPage\\ErrorPage', '2018-09-09 11:33:07', '2018-09-09 11:33:07', 'Inherit', 'Inherit', 2, 'serverfehler', 'Serverfehler', NULL, '<p>Entschuldigung, bei der Bearbeitung ihrer Anfrage ist ein Problem aufgetreten.</p>', NULL, NULL, 0, 0, 5, 0, 0, NULL, 0);
